const Header = props => {
  return (
    <header>
      <div className='container'>
        <div className='row'>
          <div className='col-sm'>Logo</div>
          <div className='col-sm'>
            <i className='mi mi-perm_contact_calendar'></i>
          </div>
          <div className='col-sm'>One of three columns</div>
        </div>
      </div>
    </header>
  );
};
export default Header;
